import React from 'react'
import Header from './Header';
import '../styles/Scaffold.css';

const Scaffold = props => {
    const { children } = props;
    return (
        <div className={'scaffold__root'}>
            <Header />
            {children}
        </div>
    )
};

export default Scaffold;
